ioc.html.body:
依赖反转
在面向对象系统中，对象封装了数据和对数据的处理，对象的依赖关系常常体现在对数据和方法的依赖上，对象之间依赖控制可以交给具体的对象完成或IoC容器来完成
如：对象之间的依赖关系图

graph TD;
A对象-->B对象;
B对象-->C对象;
B对象-->D对象;
C对象-->D对象;
D对象-->A对象;[](/beanfactory.md)
C对象-->A对象;


如果这些依赖关系交给一个具体类来负责维护和管理可想而知，该类变的极其复杂，对象之间依赖也变的高度耦合，而在IOC容器中依赖关系的发生定义成具体的类（BeanDefinition）来管理和维护业务对象之间的关系，这样就是将依赖的控制从业务上转移至容器中。
那么在Spring中什么是ioc容器以及它是如何实现这一依赖控制模式的载体？

BeanFactory和ApplicationContext都可以看成是容器的具体表现形式。如果深入到Spring的实现中去看，我们通常所说的IoC容器，实际上代表着一系列功能各异的容器产品，只是容器的功能有大有小，有各自的特点。

本章介绍了控制反转（IoC）原理的Spring Framework实现。
（参见
控制反转
依赖注入
依赖注入这是一个过程，通过这个过程对象只能通过类构造函数参数或者工厂方法的参数返回对象，返回后的实例对象通过设置属性来定义它们的依赖关系(依赖与其他对象)，然后容器在创建bean时注入这些依赖项。此过程基本上是bean本身的逆过程（因此名称，控制反转），通过使用类的直接构造或诸如服务定位器模式的机制来控制其依赖关系的实例化或位置。
