public class DefaultSingletonBeanRegistry extends SimpleAliasRegistry implements SingletonBeanRegistry {


       // 单例对象的缓存：bean名称 - > bean实例
    private final Map singletonObjects = new ConcurrentHashMap<>(256);

      // 单例工厂的缓存：bean name  - > ObjectFactory
    private final Map> singletonFactories = new HashMap<>(16);

    //早期单例对象的缓存：bean名称 - > bean实例
    private final Map earlySingletonObjects = new HashMap<>(16);

    //缓冲bean-名称注册顺序
    private final Set registeredSingletons = new LinkedHashSet<>(256);

    /** 当前正在创建的bean的名称-（整个容器） */
    private final Set singletonsCurrentlyInCreation =
            Collections.newSetFromMap(new ConcurrentHashMap<>(16));

    /** 当前从创建检查中排除的bean的名称 */
    private final Set inCreationCheckExclusions =
            Collections.newSetFromMap(new ConcurrentHashMap<>(16));


      //依赖bean名称之间的映射：bean name  - >依赖bean名称的集合
    private final Map> dependentBeanMap = new ConcurrentHashMap<>(64);

     //依赖bean名称之间的映射：bean name  - > bean依赖项的bean名称集
    private final Map> dependenciesForBeanMap = new ConcurrentHashMap<>(64);


    ...

    //注册-单利对象，bean名称相同，删除单利bean工厂，早期单利缓冲，添加注册顺序

    //删除单利bean工厂 与 addSingletonFactory 正好相反
    protected void addSingleton(String beanName, Object singletonObject) {
        synchronized (this.singletonObjects) {
            this.singletonObjects.put(beanName, singletonObject);
            this.singletonFactories.remove(beanName);
            this.earlySingletonObjects.remove(beanName);
            this.registeredSingletons.add(beanName);
        }
    }

    //获取-bena 
    //isSingletonCurrentlyInCreation(beanName)在创建bean之前都会缓冲到    
    // singletonsCurrentlyInCreation，创建完成以后删除缓冲
    protected Object getSingleton(String beanName, boolean allowEarlyReference) {
        Object singletonObject = this.singletonObjects.get(beanName);
        if (singletonObject == null && isSingletonCurrentlyInCreation(beanName)) {
            synchronized (this.singletonObjects) {
                singletonObject = this.earlySingletonObjects.get(beanName);
                if (singletonObject == null && allowEarlyReference) {
                    ObjectFactory singletonFactory = this.singletonFactories.get(beanName);
                    if (singletonFactory != null) {
                        singletonObject = singletonFactory.getObject();
                        this.earlySingletonObjects.put(beanName, singletonObject);
                        this.singletonFactories.remove(beanName);
                    }
                }
            }
        }
        return singletonObject;
    }


    //抑制异常-线程内有效
    private Set suppressedExceptions=new LinkedHashSet<>();

    protected void onSuppressedException(Exception ex) {
        synchronized (this.singletonObjects) {
            if (this.suppressedExceptions != null) {
                this.suppressedExceptions.add(ex);
            }
        }
    }

    public Object getSingleton(String beanName, ObjectFactory singletonFactory) {
        Assert.notNull(beanName, "Bean name must not be null");
        synchronized (this.singletonObjects) {

                boolean recordSuppressedExceptions = (this.suppressedExceptions == null);
                if (recordSuppressedExceptions) {
                        //在获取到锁的线程内创建一个一个抑制异常缓冲
                    this.suppressedExceptions = new LinkedHashSet<>();
                }
                try {    

                        //singletonFactory在执行getObject遇到BeanCreationException
                        //添加onSuppressedException
                        //在释放锁时使缓冲失效
                    singletonObject = singletonFactory.getObject();
                    newSingleton = true;
                }
                catch (IllegalStateException ex) {
                }
                catch (BeanCreationException ex) {

                //最后把抑制的异常统一抛出
                    if (recordSuppressedExceptions) {
                        for (Exception suppressedException : this.suppressedExceptions) {
                            ex.addRelatedCause(suppressedException);
                        }
                    }
                    throw ex;
                }
                finally {
                    if (recordSuppressedExceptions) {
                        //线程内有效
                        this.suppressedExceptions = null;
                    }

                }

            }
            return singletonObject;
        }
}


