beanpostprocessor/instantiationawarebean.body:
用于添加实例化前回调，实例化后在显式属性设置或自动装配发生之前的回调。

postProcessBeforeInstantiation在Bean实例化对象实例之前提供一次返回自定义的实例化对象
postProcessAfterInstantiation 未对Bean实例化对象属性自动装配之前-在给定的bean实例上执行自定义字段注入
postProcessPropertyValues 对给定bean实例化对象的自动装配的给定属性值进行处理


通常用于控制特定目标bean的默认实例化，如创建具有特殊TargetSource的代理（池化目标，延迟初始化目标等），或实现其他注入策略（如字段注入）。

public interface InstantiationAwareBeanPostProcessor extends BeanPostProcessor {
    @Nullable
    default Object postProcessBeforeInstantiation(Class beanClass, String beanName) throws BeansException {
        return null;
    }
    default boolean postProcessAfterInstantiation(Object bean, String beanName) throws BeansException {
        return true;
    }
    //应用于给定bean之前对给定属性值进行后处理。 允许检查是否已满足所有依赖项，
    //例如，基于bean属性setter上的“Required”批注。还允许替换要应用的属性值，通常是通过基于原始PropertyValues创建新的MutablePropertyValues实例，添加或删除特定值。默认实现按原样返回给定的pv。
    @Nullable
    default PropertyValues postProcessPropertyValues(
            PropertyValues pvs, PropertyDescriptor[] pds, Object bean, String beanName) throws BeansException {

        return pvs;
    }
}

例如：将TestBean的属性name在执行自动装配之前修改
DefaultListableBeanFactory lbf = new DefaultListableBeanFactory();
//注册InstantiationAwareBeanPostProcessorAdapter处理器
lbf.addBeanPostProcessor(new InstantiationAwareBeanPostProcessorAdapter() {
            @Override
            public boolean postProcessAfterInstantiation(Object bean, String beanName) throws BeansException {

            if (bean instanceof TestBean ) {

                        TestBean tb = (TestBean) bean;
                        Field f = TestBean.class.getDeclaredField("name");
                        f.setAccessible(true);
                        f.set(tb, "123");
                        return !skipPropertyPopulation;
                    }

            }
        });


注意：此接口是一个专用接口，主要供框架内部使用。 建议尽可能实现普通的BeanPostProcessor接口，或者从InstantiationAwareBeanPostProcessorAdapter派生，以防止对此接口的扩展。 

