applicationcontext.html.body:
ApplicationContext:
  用于为应用程序提供配置的中央接口以及运行环境。 这在应用程序运行时是只读的，但如果实现支持，则可以重新加载。 
ApplicationContext提供：

Bean工厂方法，用于访问应用程序组件继承自ListableBeanFactory。
加载文件资源的能力继承自ResourceLoader接口。
事件发布能力继承自ApplicationEventPublisher接口。
解决消息，支持国际化的能力继承自MessageSource接口。

从父上下文继承,子上下文中的定义始终优先。 

例如，整个Web应用程序可以使用单个父上下文，而每个servlet都有自己的子上下文，该上下文独立于任何其他servlet的子上下文。



public interface ApplicationContext extends EnvironmentCapable, ListableBeanFactory, HierarchicalBeanFactory,
        MessageSource, ApplicationEventPublisher, ResourcePatternResolver {
 //返回此应用程序上下文的唯一ID
 @Nullable
 String getId();
 //名称
 String getApplicationName();
  //描述
 String getDisplayName();
 //首次加载此上下文时返回时间戳 
 long getStartupDate();
 //父上下文 
 @Nullable
 ApplicationContext getParent();
 //为此上下文公开AutowireCapableBeanFactory功能
 AutowireCapableBeanFactory getAutowireCapableBeanFactory() throws IllegalStateException;
 }


