设置bean在容器启动时候是否加载（默认bean的创建发生在获取过程）


set/get_AutowireCandidate
只是针对-依据类型匹配时候自动注入到其他bean中


set/get_FactoryBeanName
bean是否指定由该工厂bean以及创建方法来创建对象


ConstructorArgumentValues
实例对象的构造函数-参数值


PropertyValues
返回要应用于bean的新实例的属性值MutablePropertyValues


isSingleton



isAbstract



