模版类表达式解析器，采用模版设计模式

public abstract class TemplateAwareExpressionParser implements ExpressionParser {

@Override
public Expression parseExpression(String expressionString) {
   return parseExpression(expressionString, null);
}



//模版方法-控制顶级逻辑骨架
@Override
public Expression parseExpression(String expressionString, @Nullable ParserContext context) {

    //提供了解析上下文由该类解析，解析完成以后在由子类解析
    if (context != null && context.isTemplate()) {
        return parseTemplate(expressionString, context);
    }
    else {
       //子类解析
       return doParseExpression(expressionString, context);
    }
}

protected abstract Expression doParseExpression(String expressionString, @Nullable ParserContext context)
private Expression parseTemplate(String expressionString, ParserContext context){
    if (expressionString.isEmpty()) {
        return new LiteralExpression("");
    }

    Expression[] expressions = parseExpressions(expressionString, context);
    if (expressions.length == 1) {
        return expressions[0];
    }
    else {
        return new CompositeStringExpression(expressionString, expressions);
    }
}


