lifecycle.html.body:
Lifecycle接口让任何bean有自己的生命周期需求。
任何spring管理的对象都可以实现这个接口。那么，当ApplicationContext自身启动和停止时，它将自动调用上下文内所有生命周期的实现。通过委托给LifecycleProcessor来做这个工作。 

public interface Lifecycle {  
  void start();  
  void stop();  
  boolean isRunning();  
}

当ApplicationContext接口启动和关闭时，它会调用本容器内所有的Lifecycle实现

protected Map getLifecycleBeans() {

        ConfigurableListableBeanFactory beanFactory = getBeanFactory();

        Map beans = new LinkedHashMap<>();

        String[] beanNames = beanFactory.getBeanNamesForType(Lifecycle.class, false, false);

        for (String beanName : beanNames) {

            String beanNameToRegister = BeanFactoryUtils.transformedBeanName(beanName);

            boolean isFactoryBean = beanFactory.isFactoryBean(beanNameToRegister);

            String beanNameToCheck = (isFactoryBean ? BeanFactory.FACTORY_BEAN_PREFIX + beanName : beanName);

            if ((beanFactory.containsSingleton(beanNameToRegister) &&
                    (!isFactoryBean || matchesBeanType(Lifecycle.class, beanNameToCheck, beanFactory))) ||
                    matchesBeanType(SmartLifecycle.class, beanNameToCheck, beanFactory)) {

                Object bean = beanFactory.getBean(beanNameToCheck);

                if (bean != this && bean instanceof Lifecycle) {
                    beans.put(beanNameToRegister, (Lifecycle) bean);
                }
            }
        }
        return beans;
    }

