HandlerInterceptor实现类,包含并委托对HandlerInterceptor的调用以及拦截器应该应用的包含（和可选地排除）路径模式。还提供匹配逻辑以测试拦截器是否适用于给定的请求路径。

MappedInterceptor可以直接在任何AbstractHandlerMethodMapping中注册。此外，AbstractHandlerMethodMapping（包括祖先的ApplicationContext）会自动检测MappedInterceptor类型的bean，这实际上意味着拦截器使用所有处理程序映射“全局”注册。

