为给定的处理程序HandlerMethod构建处理程序执行链(HandlerExecutionChain)以及适用的拦截器(HandlerInterceptor)

对当前handler转换或者创建一个新的处理程序执行链HandlerExecutionChain
遍历注册到当前HandlerMapping中拦截器HandlerInterceptor添加到处理程序执行链中
如当前HandlerInterceptor是MappedInterceptor的实例，只有请求路径在当前拦截器拦截范围内才添加



如下：为给定请求构建一个HandlerExecutionChain
//构建处理程序执行链和拦截器
protected HandlerExecutionChain getHandlerExecutionChain(Object handler, HttpServletRequest request) {
//创建和转换handler为HandlerExecutionChain
HandlerExecutionChain chain = (handler instanceof HandlerExecutionChain ?
(HandlerExecutionChain) handler : new  HandlerExecutionChain(handler));

// 操作路径 如：/aaa
String lookupPath = this.urlPathHelper.getLookupPathForRequest(request);

for (HandlerInterceptor interceptor : this.adaptedInterceptors) {

  if (interceptor instanceof MappedInterceptor) {
    MappedInterceptor mappedInterceptor = (MappedInterceptor) interceptor;
    if (mappedInterceptor.matches(lookupPath, this.pathMatcher)) {
        chain.addInterceptor(mappedInterceptor.getInterceptor());
    }
  }
  else {
  chain.addInterceptor(interceptor);
  }
 }
    return chain;
}


在BeanFactory查处MappedInterceptor
protected void detectMappedInterceptors(List mappedInterceptors) {

   Collection collection = BeanFactoryUtils.beansOfTypeIncludingAncestors(
   obtainApplicationContext(), MappedInterceptor.class, true, false).values();

   mappedInterceptors.addAll(collection);
}

