为处理程序方法的映射指定名称的策略接口

可以在AbstractHandlerMethodMapping上配置策略。它用于为每个已注册的处理程序方法的映射指定名称。然后可以通过AbstractHandlerMethodMapping＃getHandlerMethodsForMappingName查询名称。
