public interface HandlerMethodMappingNamingStrategy {

 //HandlerMethod 和url（mapping） 返回名称
  String getName(HandlerMethod handlerMethod, T mapping);

}

//如SimpleMappingNamingStrategy处理是直接返回方法名称：
private static class SimpleMappingNamingStrategy implements HandlerMethodMappingNamingStrategy {

        @Override
        public String getName(HandlerMethod handlerMethod, String mapping) {
            return handlerMethod.getMethod().getName();
        }
