websocket/websockethandler.html.body:
WebSocket消息和生命周期事件的处理程序接口

默认情况下会记录异常并使用SERVER_ERROR（1011）关闭会话。异常处理策略由ExceptionWebSocketHandlerDecorator提供，可以通过使用不同的装饰器来装饰WebSocketHandler来定制或替换它。


public interface WebSocketHandler {

    //在WebSocket协商成功并且WebSocket连接打开并准备好使用后调用。
    void afterConnectionEstablished(WebSocketSession session) throws Exception;

    //在新的WebSocket消息到达时调用。
    void handleMessage(WebSocketSession session, WebSocketMessage message) throws Exception;

    //处理底层WebSocket消息传输中的错误。
    void handleTransportError(WebSocketSession session, Throwable exception) throws Exception;

    //WebSocket连接被任何一方关闭后，或者在发生传输错误后调用。虽然会话在技术上可能仍然是开放的，但取决于底层实现，此时不鼓励发送消息，并且很可能不会成功。
    void afterConnectionClosed(WebSocketSession session, CloseStatus closeStatus) throws Exception;

    //WebSocketHandler是否处理部分消息。如果此标志设置为true并且底层WebSocket服务器支持部分消息，则可以拆分大型WebSocket消息或未知大小的消息，并且可以通过多次调用handleMessage（WebSocketSession，WebSocketMessage）来接收。标志WebSocketMessage.isLast（）指示消息是否是部分消息以及它是否是最后一部分。
    boolean supportsPartialMessages();

}


