resource.html.body:
资源：作为InputStreamSource对象的简单接口，这是Spring更广泛的Resource接口的基础接口。
对于一次性使用的流，InputStreamResource可用于任何给定的InputStream。 Spring的ByteArrayResource或任何基于文件的Resource实现都可以用作具体实例，允许用户多次读取底层内容流。例如，这使得此接口可用作邮件附件的抽象内容源。

从实际类型的底层资源（例如文件或类路径资源）中抽象出来的资源描述符的接口。
如果InputStream以物理形式存在，则可以为每个资源打开，但只能为某些资源返回URL或File句柄。实际行为是特定于实现的


public interface Resource extends InputStreamSource {
boolean exists();
default boolean isReadable() {
    return exists();
}

default boolean isOpen() {
    return false;
}


default boolean isFile() {
    return false;
}


URL getURL() throws IOException;


URI getURI() throws IOException;

File getFile() throws IOException;

default ReadableByteChannel readableChannel() throws IOException {
    return Channels.newChannel(getInputStream());
}


long contentLength() throws IOException;


long lastModified() throws IOException;


Resource createRelative(String relativePath) throws IOException;

@Nullable
String getFilename();


String getDescription();

}

